function areBracketsBalanced(expr) {

    // ArrayDeque is faster than using Stack class
    let stack = [];
    for(let i = 0; i &lt; expr.length; i++) {
        let x = expr[i];
        if (x == &apos;(&apos; || x == &apos;[&apos; || x == &apos;{&apos;) {

            // Push the element in the stack
            stack.push(x);
            continue;
        }

        if (stack.length == 0) // If current character is not opening
            return false;

        let check;
        switch (x) {
        case &apos;)&apos;:
            check = stack.pop();
            if (check == &apos;{&apos; || check == &apos;[&apos;)
                return false;
            break;

        case &apos;}&apos;:
            check = stack.pop();
            if (check == &apos;(&apos; || check == &apos;[&apos;)
                return false;
            break;

        case &apos;]&apos;:
            check = stack.pop();
            if (check == &apos;(&apos; || check == &apos;{&apos;)
                return false;
            break;
        }
    }

    // Check Empty Stack
    return (stack.length == 0);
